import React from 'react'
import {Contact} from '../components'

export default function contactsMasonry({Contacts, State}){

    return( 
            <div  id="list-wrapper">         
                    {Contacts.map((contact, index) =>
                        <Contact {...{contact, index, State}}/>
                    )}
              </div>
    )
}
